import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h1>Scopify</h1>
        <h3>Generate your horoscope playlist based off your sign and listening habits.</h3>
        <button>log in with Spotify</button>
      </header>
    </div>
  );
}

export default App;
